package anagramInStringtest;


import static org.junit.Assert.assertEquals;

import java.util.List;

import org.junit.Test;

import anagram.Solution;

public class SolutionTest {
  String s;
  String p;
  Solution solution1 = new Solution();
  List<Integer> list1 = List.of(0, 1, 2);
  List<Integer> list2 = List.of(0, 6);
  List<Integer> list3 = List.of(0, 10001);

  
  @Test
  public void test() {
    s = "cbaebabacd";
    p = "abc";
    
    assertEquals(list2, solution1.findAnagrams(s, p));
  }
  
  @Test
  public void test2() {
    s = "abab";
    p = "ab";
    assertEquals(list1, solution1.findAnagrams(s, p));
  }
  
  @Test
  public void test3() {
    s = "";
    p = "";
    System.out.println(s.length());
    System.out.println(p.length());
    assertEquals(list3, solution1.findAnagrams(s, p));
  }
}
